import React, { useState } from 'react'

const App = () => {
    const [count, setcount] = useState(0);

    const handleClick = () => {
        setcount(count + 1)
    };

    return (
        <>
            <button onClick={handleClick}>Add Animal</button>
            <div>Number og animals: {count}</div>
        </>
    )
}

export default App
